- input: "TEXT\x1CC00396655\x1C2\x1C\x1CF3XA\x1C\"This amended report carries forward
    the corrected opening balance carried forward from the previous amended report.
    \ A review of our records also indicated that our original report failed to disclose
    a single $500 contribution to a Federal candidate (see page 9).  We have confirmed
    that this contribution was indeed received by the recipient committee.  This omission
    was not due to an effort to cover our participation in the 2006 federal campaign,
    but rather poor recordkeeping and report preparation.  We have since hired a vendor
    to assist us with reporting services to correct this problem.  Note that the contribution
    was our last to a Federal candidate or committee, and represents only 2% of the
    expenditures for the period.  Additionally, we are now disclosing our administrative
    expenses on Schedule B supporing Line 21(b) to separate these expenses from our
    contributions to non-federal candidates in San Antonio (which is the main mission
    of the PAC).  This report does include several non-federal contributions also
    inadvertently omitted from the original report, but confirmed as written and cleared
    through our voluntary audit.  Please update your records accordingly.\""
